import React from 'react';
import styled from 'styled-components';
import Paragraf from './ParagrafMain.js';
import Link from '../../Link.js';
import '../../Nav/GlobalNav.js';
import SubTitles from '../SubTitle.js';
import Grafic from '../../../img/grafic.svg';


const Container = styled.div`
    width: 483px;
    height: 370px;
    padding: 45px 40px;
    position: relative;
    background: #87BBFD;
    position: relative;
    perspective: 1500px;
    transform: translate3d(20px, 15px, -10px);
`
const InContainer = styled.div`
    width: 403px;
    height: 242px;
    padding: 20px;
    position: absolute;
    bottom: 0px;
    background: #fff;
`


class ImageCheckout extends React.Component {
  render(){
    return (
        <Container>
            <InContainer>

            </InContainer>
        </Container>
    );
  }
}
export default ImageCheckout;
